package dsa_practise_16th_April_2022;

public class PrintNumbersIteratively {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int n =10;
		
		for(int i =1;i<=n;i++)
		{
			System.out.println(i);
		}
		
		int j =1;
		while(j<=n)
		{
			j++;
			System.out.println(j);

		}
		
	}

}
